  portion of the Cape Ann to Salisbury Beach Massachusetts survey area (RESON_BS5M.tif,
  UTM Zone 19, WGS84)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 21,\n\t\t\"recent\":
